import React from "react";
import { useSelector } from "react-redux";

const List = () => {
  const todos = useSelector((state) => state.counter.list);

  return (
    <div>
      <h2>working</h2>
      <div>
        {todos.map((emList) => (
          <div key={emList.id}>
            <h2>{emList.title}</h2>
            <h3>{emList.body}</h3>
          </div>
        ))}
      </div>
      <h2>Done</h2>
      <div></div>
    </div>
  );
};

export default List;
